import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const CommunityPageContainer = styled.div`
    color:#333333;

    .contentContainer{
        .contentWrap{
            max-width:1200px;
            height: auto;
            margin:0 auto;
        }
    }
`;

const CommunityPage = memo(() => {
    return (
        <CommunityPageContainer>
            <Title title='커뮤니티' txt='여러분의 다양한 의견을 자유롭게 나눠보세요.' />
            <div className='contentContainer'>
                <div className='contentWrap'>
                    <form className='searchForm'>
                        <input type='text' placeholder='제목을 이벽하여 검색하세요.' />
                        <button type='button' className='searchBtn'>검색</button>
                    </form>
                    <table className='tableList'>
                        <colgroup>
                            <col style={{width:"5%", backgroundColor:"#ff05"}}></col>
                            <col style={{width:"80%", backgroundColor:"#f0f5"}}></col>
                            <col style={{width:"15%", backgroundColor:"#0ff5"}}></col>
                        </colgroup>
                    </table>
                </div>
            </div>
        </CommunityPageContainer> 
    );
});

export default CommunityPage;
